import React from "react";
import "./register-form.css";

export const RegisterForm = ({label, onChangeForm, onSubmitForm}) => {
    return (
        <form className="col s12">
            <div className="row focus">
                <div className="input-field col s6 form focus">
                    <i className="material-icons prefix active">mode_edit</i>
                    <input
                        type="text"
                        id="icon_prefix2"
                        className="materialize-textarea focus"
                        value={label}
                        onChange={event => onChangeForm(event.target.value)}
                        onKeyDown={onSubmitForm}
                    >
                    </input>
                    <label htmlFor="icon_prefix2">What you need to do</label>
                </div>
            </div>
        </form>
    )
};
